                        <h1>Have The Best With US...</h1>
                        <h2>Create your best style here...</h2>
                    </Introductiontothesubject>
            </div>
            <Fashion>
               <FashionLayout/>
            </Fashion>
                           
                          
        </div>
    )
}
export default Homepage
